const id = param.id;

useEffect(()=>{
    axios.get("http://localhost/laravel8/laravel8/public/api/blog/detail/" + id)
    .then(res =>{
        setData(res.data.blog)
           
    })
    .catch(function (error) {
        console.log(error)
    })
},[])
function renderData(){
